import React, { useState } from 'react';
import { type SVGProps } from 'react';
import { motion as m, AnimatePresence } from 'framer-motion';

const SvgComponent = (props: SVGProps<SVGSVGElement>): JSX.Element => {
  const [show, setShow] = useState(false);

  // const [show, setShow] = useState(true);
  const handLtrFirst = {
    initial: {
      x: -200,
    },
    animate: {
      x: 0,
      transition: { duration: 0.7, delay: 0.5 },
    },
    exit: {
      x: -200,
    },
  };

  const handLtrSecond = {
    initial: {
      x: -200,
    },
    animate: {
      x: 0,
      transition: { duration: 0.7, delay: 0.25 },
    },
  };

  const handRtlFirst = {
    initial: {
      x: 200,
    },
    animate: {
      x: 0,
      transition: { duration: 0.7 },
    },
  };

  const handRtlSecond = {
    initial: {
      x: 200,
    },
    animate: {
      x: 0,
      transition: { duration: 0.7, delay: 0.75 },
    },
  };

  const woman = {
    initial: {
      opacity: 0,
    },
    animate: {
      opacity: 1,
      transition: { duration: 2 },
    },
  };

  return (
    <>
      <button
        onClick={() => {
          setShow(!show);
        }}
      >
        click me
      </button>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width={584}
        height={591}
        viewBox="0 0 584 591"
        {...props}
      >
        <image
          x={248}
          y={1}
          width={120}
          height={589}
          xlinkHref="data:img/png;base64,"
        />

        <AnimatePresence>
          {show ? (
            <m.image
              key="handLtrFirst"
              variants={handLtrFirst}
              initial="initial"
              animate="animate"
              exit="exit"
              x={134}
              width={236}
              height={262}
              xlinkHref="data:img/png;base64,"
            />
          ) : null}
        </AnimatePresence>

        <m.image
          variants={handRtlFirst}
          initial="initial"
          animate="animate"
          x={267}
          y={453}
          width={244}
          height={108}
          xlinkHref="data:img/png;base64,"
        />
        <m.image
          variants={handRtlSecond}
          initial="initial"
          animate="animate"
          x={306}
          y={30}
          width={209}
          height={283}
          xlinkHref="data:img/png;base64,"
        />
        <m.image
          variants={handLtrSecond}
          initial="initial"
          animate="animate"
          y={279}
          width={360}
          height={267}
          xlinkHref="data:img/png;base64,"
        />
        <m.image
          variants={woman}
          initial="initial"
          animate="animate"
          x={299}
          y={200}
          width={38}
          height={145}
          xlinkHref="data:img/png;base64,"
        />
      </svg>
    </>
  );
};

export default SvgComponent;
